export default function Matches() {
    const [matches, setMatches] = useState(originalmatches);
    const [selectedProfile, setSelectedProfile] = useState(null);
    const [likeConfirmation, setLikeConfirmation] = useState(null);
    const [showFilter, setShowFilter] = useState(false);
    const [filteredMatches, setFilteredMatches] = useState(matches);
    const [minAge, setMinAge] = useState('');
    const [maxAge, setMaxAge] = useState('');
    const [genderFilter, setGenderFilter] = useState('');
    const [useAlgorithm, setUseAlgorithm] = useState(false);


    const toggleFilterPopup = () => {
        setShowFilter(!showFilter);
    };

    const handleClick = (match) => {
        setSelectedProfile(match);
    };

    const likeProfile = () => {
        setLikeConfirmation(`You liked ${selectedProfile.name}! If ${selectedProfile.name} likes you back, we will offer a way of contacting them through the website!`);
        setSelectedProfile(null);
    };

    const dislikeProfile = () => {
        console.log("Disliked Profile:", selectedProfile.name);
        setSelectedProfile(null);
    };

    const generateRandomParagraph = (match) => {
        const hobbies = ['reading', 'cooking', 'hiking', 'painting', 'gardening', 'photography', 'playing guitar', 'traveling', 'yoga', 'running'];
        const randomHobby = hobbies[Math.floor(Math.random() * hobbies.length)];
        return `Hi there, my name is ${match.name}. I'm ${match.age} years old and identify as ${match.gender}. In my free time, I enjoy ${randomHobby}!`;
    };

    const applyFilters = () => {
        const filtered = matches.filter(match => {
            return (!minAge || match.age >= minAge) &&
                   (!maxAge || match.age <= maxAge) &&
                   (!genderFilter || match.gender === genderFilter);
        });
        setFilteredMatches(filtered);
        setShowFilter(false);
    };

    const handleCheckboxChange = (event) => {
        setUseAlgorithm(event.target.checked);
        if (event.target.checked) {
            // Randomize the matches array when the checkbox is checked
            setMatches(shuffleArray(matches));
        } else {
            // Reset to original order when the checkbox is unchecked
            setMatches(originalMatches);
        }
    };

   const shuffleArray = (array) => {
        for (let i = array.length - 1; i > 0; i--) {
            const j = Math.floor(Math.random() * (i + 1));
            [array[i], array[j]] = [array[j], array[i]];
        }
        return array;
    };

    return (
        <main className="flex flex-col items-center justify-center min-h-screen p-4 bg-blue-50 font-serif">
            <h1 className="text-4xl font-bold mb-8 text-blue-500">Potential Matches</h1>
              <button className="px-4 py-2 mb-4 text-sm font-semibold text-white bg-blue-700 rounded-full shadow-lg hover:bg-blue-800 transition duration-300" onClick={toggleFilterPopup}>
                Filter
             </button>
            {showFilter && (
                <div className="absolute top-20 bg-white p-4 rounded shadow-lg z-10">
                    <div className="mb-4">
                        <label className="block text-gray-700 text-sm font-bold mb-2" htmlFor="minAge">Min Age</label>
                        <input type="number" id="minAge" className="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline" placeholder="Minimum Age" value={minAge} onChange={e => setMinAge(e.target.value)} />
                    </div>
                    <div className="mb-4">
                        <label className="block text-gray-700 text-sm font-bold mb-2" htmlFor="maxAge">Max Age</label>
                        <input type="number" id="maxAge" className="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline" placeholder="Maximum Age" value={maxAge} onChange={e => setMaxAge(e.target.value)} />
                    </div>
                    <div className="mb-4">
                        <label className="block text-gray-700 text-sm font-bold mb-2" htmlFor="genderFilter">Gender</label>
                        <select id="genderFilter" className="shadow border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline" value={genderFilter} onChange={e => setGenderFilter(e.target.value)}>
                            <option value="">Any</option>
                            <option value="Male">Male</option>
                            <option value="Female">Female</option>
                        </select>
                    </div>
                    <div>
                    <label style={{ color: 'black' }}>
                        <input
                        type="checkbox"
                        checked={useAlgorithm}
                        onChange={handleCheckboxChange}
                        />
                        Use our algorithm
                    </label>
                    </div>

                    <button className="px-4 py-2 text-sm font-semibold text-white bg-blue-500 rounded-full shadow-lg hover:bg-blue-600 transition duration-300 mt-4" onClick={applyFilters}>
                        Apply Filters
                    </button>
                    <button className="px-4 py-2 text-sm font-semibold text-white bg-red-500 rounded-full shadow-lg hover:bg-red-600 transition duration-300 mt-4 ml-4" onClick={toggleFilterPopup}>
                        Close
                    </button>
                </div>
            )}
            <div className="flex flex-wrap justify-center gap-4">
            {filteredMatches.map(match => ( 
                <div key={match.name} className="w-40 bg-white shadow-md rounded-lg p-4 flex flex-col items-center">
                    <img className="rounded-full mb-2 cursor-pointer" src={match.imageUrl} alt={match.name} onClick={() => handleClick(match)} />
                    <p className="text-gray-700 text-sm font-bold">{match.name}</p>
                    <span className="text-gray-600 text-xs">Age: {match.age}</span>
                    <span className="text-gray-600 text-xs">Gender: {match.gender}</span> {}
                </div>
            ))}
        </div>
            {selectedProfile && (
                <div className="fixed top-0 left-0 w-full h-full bg-black bg-opacity-50 flex items-center justify-center">
                    <div className="bg-white p-4 rounded-lg">
                        <div className="flex items-center justify-between mb-4">
                            <img src={selectedProfile.imageUrl} alt={selectedProfile.name} className="rounded-full w-24 h-24 mr-4" />
                            <div>
                                <p className="text-gray-700 text-lg font-bold">{selectedProfile.name}</p>
                                <p className="text-gray-600 text-sm">Age: {selectedProfile.age}</p>
                                <p className="text-gray-700 text-sm">{generateRandomParagraph(selectedProfile)}</p>
                            </div>
                        </div>
                        <div className="flex justify-between">
                            <button className="px-4 py-2 text-sm font-semibold text-white bg-green-500 rounded-full shadow-lg hover:bg-green-600 transition duration-300" onClick={likeProfile}>✔ Like</button>
                            <button className="px-4 py-2 text-sm font-semibold text-white bg-red-500 rounded-full shadow-lg hover:bg-red-600 transition duration-300" onClick={dislikeProfile}>✖ Not Like</button>
                        </div>
                        <button className="px-4 py-2 text-sm font-semibold text-white bg-blue-500 rounded-full shadow-lg hover:bg-blue-600 transition duration-300 mt-4" onClick={() => setSelectedProfile(null)}>Close</button>
                    </div>
                </div>
            )}
            {likeConfirmation && (
                <div className="fixed top-0 left-0 w-full h-full bg-black bg-opacity-50 flex items-center justify-center">
                    <div className="bg-white p-4 rounded-lg">
                        <p className="text-gray-700 text-lg">{likeConfirmation}</p>
                        <button className="px-4 py-2 text-sm font-semibold text-white bg-blue-500 rounded-full shadow-lg hover:bg-blue-600 transition duration-300 mt-4" onClick={() => setLikeConfirmation(null)}>OK</button>
                    </div>
                </div>
            )}
            {/* {matches.map(match => (
                <div key={match.name} onClick={() => handleClick(match)}>
                    {match.name}, {match.age}, {match.gender}
                </div>
            ))} */}
            {selectedProfile && (
                <div>
                    <h2>{selectedProfile.name}</h2>
                    <button onClick={likeProfile}>Like</button>
                    {}
                </div>
            )}
        <Link href="/likes" passHref>
        <div style={{ position: 'fixed', top: '20px', left: '1275px'}}> {/* Use a div to position the button */}
            <button className="custom-button flex justify-end p-4 px-9 py-2 text-xl font-semibold text-white bg-pink-500 rounded-full shadow-lg hover:bg-blue-700 transition duration-300">
            Likes
            </button>
        </div>
        </Link>
        <Link href="/groups" passHref>
        <div style={{ position: 'fixed', top: '20px', left: '1075px'}}> {/* Use a div to position the button */}
            <button className="custom-button flex justify-end p-4 px-9 py-2 text-xl font-semibold text-white bg-green-500 rounded-full shadow-lg hover:bg-blue-700 transition duration-300">
            Groups
            </button>
        </div>
        </Link>
        <Link href="/" passHref>
        <div style={{ position: 'fixed', top: '20px', left: '75px'}}> {/* Use a div to position the button */}
            <button className="custom-button flex justify-end p-4 px-9 py-2 text-xl font-semibold text-white bg-blue-500 rounded-full shadow-lg hover:bg-blue-700 transition duration-300">
            Home
            </button>
        </div>
        </Link>
     

        </main>
        );
}